					<p>
实地蔷薇国际，贵州省100个城市综合体之一，总建筑面积320万方，雄踞遵义新蒲新区中心地段，扼守“四横三纵”道路网，占据播州大道、新浦大道、长征大道、平安大道等城市主干道；项目北接遵义国际金融中心；南临遵义文化小学新蒲分校、遵义十二中；东临遵义医学院附属医院新蒲分院，西南与遵义四中、北接大学城、遵义湿地公园临街相望；项目整体规划有遵义国际会议展览中心、五星级新城大酒店、大型shopping mall、风情商业街、高端奢华会所、高层住宅、商务公寓、临街旺铺及法式别墅，是一个集高端居住、金融公寓、休闲娱乐于一体的大型高端城市综合体。
